(window.webpackJsonp=window.webpackJsonp||[]).push([[59],{120:function(e){e.exports={data:{post:{title:"Can't hold on much longer",content:'<p>This stinks.</p>\n<p>I am used to rejection, but this is getting absurd.</p>\n<p><a href="/assets/static/src/media/images/blog/storyofmylife.gif"><img class="g-image g-image--lazy g-image--loading" src="data:image/svg+xml,%3csvg fill=\'none\' viewBox=\'0 0 1280 323\' xmlns=\'http://www.w3.org/2000/svg\' xmlns:xlink=\'http://www.w3.org/1999/xlink\'%3e%3cdefs%3e%3cfilter id=\'__svg-blur-4\'%3e%3cfeGaussianBlur in=\'SourceGraphic\' stdDeviation=\'40\'/%3e%3c/filter%3e%3c/defs%3e%3cimage x=\'0\' y=\'0\' filter=\'url(%23__svg-blur-4)\' width=\'1280\' height=\'323\' xlink:href=\'data:image/gif%3bbase64%2ciVBORw0KGgoAAAANSUhEUgAAAEAAAAAQCAIAAAAphe5%2bAAAACXBIWXMAAAPoAAAD6AG1e1JrAAADQUlEQVRIx9VW2XLaMBTl/z8jj3lJ/yF9aqcpCbssG9tY3oSh4BXLS48kQkknzHQSppPcUZyLdDfpnCt70HZd1/d4tC3%2bv0Xg21xJLsXvjxW2QghtWde11gf5fs%2bmkzTLMBFFESHENE3LtAgxqEGpSR3HYYyFYRjHcaSEc54kCRRM8piXZakTvFNQHyJ7noeMtm2v12vERxYotu3keY5ykSvwfeZ5eZbHUZyl2aBI04DSsqz2%2bz2ldLEgruuu3JVlWVCSdYKgKJ0rCQK4%2b1C22%2b1ms0mU4DD6awj2sNvtUDHSYRvQkUKeEecorKoq7BAbwCoONE1T1IBdDbRzURSoBw7arv%2bogto0XJpIUI4bqA5in5VpXmVFJdTCv8sV67vIrstZBnpluy%2bcYEOceGSwXaY43X8OGfy5SVo5tCKaVj9r/ClFiFYrh1pgEkOvNnJGPoUasAaYtZD2RVVDP%2bBnI4MAV1hq39Moq1o7Sl066oBCZqmbgxxSxzSWVOpjujMEuiMCj4QNFx5d8TH1iRsv2XpmhcO5N6HBcdKJMX7OVyPDn1gB9IeZa674t7HtBhvDjed2OFysEMTxE7g/GQzuCDsxg/kyWtjRxPShTM0QvnM7gsuPqQvkEf9x4SHaGJZ2hLwjwohUAgy4G7KeZGz4eA4JizepOvQzCoE2SAz%2bPBKPutzy1lMz0BU/zFaGy6eItQxNl8Nmqqr/PnFQIpKhbmlvhSgaG0AXnS5vLRrM9vlF051x/Zn3vWa5BEpdId1LDitm9KfxCoUkiLUE%2bvQ6a2Wnt3oGulD0kpNt2yiqCMUixY5OXw2NMj7hqwp9sZNXK3hvDxwRSEuc64j6tp8AayqJ4eBELbZ2ggSMohKEkHp84UQaZQACY5slIBVxwAcOXgGKiYLuiTDqxjAD%2boYTmx7HPPg2X4JmHhyv3MQaSqGPvAMgjbpPVW9VolKNi46UTakaUeu6t8pDfVrSq%2bg29VPOwAjdDB1m6g6QvkVZXw8BBcFml6NvWPwLR4gexcm9%2bdPof1%2bjegN8m90/UNwnI8qSXbZLC5zcZ3oPyJdA15cCLPosb7C/eqDrZrPZl7u7m5ub29vb%2b/uv%2bJy69H37oeQ3Ah6iMOoZi1IAAAAASUVORK5CYII=\' /%3e%3c/svg%3e" width="1280" alt="One of many." data-srcset="/assets/static/storyofmylife-w480.415b8e47a2ce9adebe3ecbc822c94027.gif 480w, /assets/static/storyofmylife-w1024.415b8e47a2ce9adebe3ecbc822c94027.gif 1024w" data-sizes="(max-width: 1280px) 100vw, 1280px" data-src="/assets/static/storyofmylife-w1024.415b8e47a2ce9adebe3ecbc822c94027.gif"><noscript><img class="g-image g-image--lazy g-image--loaded" src="/assets/static/storyofmylife-w1024.415b8e47a2ce9adebe3ecbc822c94027.gif" width="1280" alt="One of many."></noscript></a>\n<em>One of many.</em></p>\n<p>Over and over again I get turned down for roles with a generic mail merge response. The most annoying thing is how positive I feel all the interviews go. I get along well with the people plus I am familiar with every scenario and software environment that is brought up. I’d like to think I could learn something from each and every interview, but even with a time machine I have no idea how I could go back and change things to improve my chances. I almost wish I was crashing and burning so I could clearly see how I would improve things for next time.</p>\n<p>Am I doing something wrong? Ugh, probably not. There is a whole boatload of people after work in this city, only the most arrogant would assume they are automatically the best person for a job.</p>\n<p>Right now my savings are melting away as I pay for rent and living out of the savings. I get up every morning and get on my good old Chuwi to investigate any new job listings that have popped up. I craft a nice cover letter for whatever listings I think I have a 1% chance of getting, hit submit and wait. I also try to follow up, but not being annoying is key when seeking employment.</p>\n<p>I also have a little bit of a cough. Not too bad, but enough to be a pain. It doesn’t help that my rented place can get a bit damp, requiring the windows to be open during the day to help dry it out. If I can hold out to summer I’m sure this place will be great, though.</p>\n<p><a href="https://www.youtube.com/watch?v=4fo__Sh0nIg" target="_blank" rel="nofollow noopener noreferrer">I know I can’t hold on much longer</a> <a href="https://www.youtube.com/watch?v=4fo__Sh0nIg" target="_blank" rel="nofollow noopener noreferrer">…but I will never let go</a></p>\n<p><a href="https://www.youtube.com/watch?v=4fo__Sh0nIg" target="_blank" rel="nofollow noopener noreferrer">I know that it’s a one way track</a> <a href="https://www.youtube.com/watch?v=4fo__Sh0nIg" target="_blank" rel="nofollow noopener noreferrer">…tell me now how long this’ll last</a></p>\n<p>Wasn’t 1999 such a simpler time? I would start playing Sonic Adventure, but I’m sure I’d be disappointed that it doesn’t live up to how I remember it. At least I have this beautiful framed piece of art on my wall to keep my spirits up.</p>\n<p><a href="/assets/static/src/media/images/blog/IMG_20170919_130623.jpg"><img class="g-image g-image--lazy g-image--loading" src="data:image/svg+xml,%3csvg fill=\'none\' viewBox=\'0 0 1920 1440\' xmlns=\'http://www.w3.org/2000/svg\' xmlns:xlink=\'http://www.w3.org/1999/xlink\'%3e%3cdefs%3e%3cfilter id=\'__svg-blur-69\'%3e%3cfeGaussianBlur in=\'SourceGraphic\' stdDeviation=\'40\'/%3e%3c/filter%3e%3c/defs%3e%3cimage x=\'0\' y=\'0\' filter=\'url(%23__svg-blur-69)\' width=\'1920\' height=\'1440\' xlink:href=\'data:image/jpeg%3bbase64%%2b2rMYphEHYnnjWdDhsrGyuLFN0UqKm4sSu/P35x8UN1Jo66cUeOWJ5JQHZEwcDJyQRwB7DvzTrYy3EmlRG%2bvLVCqoyRohWQEHPYj/eKJZdI1hR6x3jlkBZWQLsTtnP3OB37ZrXHKFjuEVUnPEboJxKbv9qIel6PYwoHurkFZAPTldwbcefbg/TinnoOya1u9WmRW2SWU0jvIuHL5A55J7Yqjv7RoLr0ULNdW8I3wyJCS0ZHO3j5xmnjpXT7m20LVrm6AXNkQEA/lyR3P1NIyWL9jf7%2bwlZSBqjr7%2boNAn8InxWe9WRibX50dVbZGm0YyRxWlwxkWkfxVHrGlWtzveW3jaRhgtjBI%2bRWRjWVMamwRAcVJrEBu%2bndQtogGllgdFXOMkioY34qQvmqF0bifMpdK0WwtbJI71IJJdqhw2HPHYcCuzoGg%2bYXj0eBmK7SRAACO%2bOauQVHYCuFxTmzFvQnKOnwTAPKES7bezhiX/voBQN6tw9vLC8qrDINroi4yKt5HBzVfdkYNAzu3kz0ACL88QRAo7ClDxKurjSukru9snRJowmNybgcsBj/PenW6wTWReI2uy3%2bgtpzbG827iRWHBwHzj79qHGu5zGf/2Q==\' /%3e%3c/svg%3e" width="1920" alt="All Mighty Hedgehog." data-srcset="/assets/static/IMG_20170919_130623-w480.711ba1f7f2da8d25a7be4a5a7d4efdec.jpg 480w, /assets/static/IMG_20170919_130623-w1024.711ba1f7f2da8d25a7be4a5a7d4efdec.jpg 1024w, /assets/static/IMG_20170919_130623-w1920.711ba1f7f2da8d25a7be4a5a7d4efdec.jpg 1920w" data-sizes="(max-width: 1920px) 100vw, 1920px" data-src="/assets/static/IMG_20170919_130623-w1920.711ba1f7f2da8d25a7be4a5a7d4efdec.jpg"><noscript><img class="g-image g-image--lazy g-image--loaded" src="/assets/static/IMG_20170919_130623-w1920.711ba1f7f2da8d25a7be4a5a7d4efdec.jpg" width="1920" alt="All Mighty Hedgehog."></noscript></a>\n<em>All Mighty Hedgehog.</em></p>\n<p><a href="mailto:aaronights@gmail.com" target="_blank" rel="nofollow noopener noreferrer">Email me with offers and advice: aaronights@gmail.com.</a></p>\n',date:"2017-09-18T12:00:00+12:00",timeToRead:1}}}}}]);